import React, { useEffect, useState } from 'react'

function UseEffectHookA() {
    const [userInp,setUserInp]=useState('')
    useEffect(()=>{
        console.log('useEffectHookA component');
    })

    return (
        <>
            <div>UseEffectHookA</div>
            <div className='form-floating'>
                <input className='form-control'
                    type='text'
                    placeholder=''
                    value={userInp}
                    onChange={(e)=>setUserInp(e.target.value)}
                />
                <label className='form-floating-label'>Enter your name</label>
            </div>
        </>
    )
}

export default UseEffectHookA
